function Users(props) {

    let {par} = useParams();

    const [receiver, setReceiver] = useState({});
    if (!receiver.length) {
        axios.get(`http://localhost:8000/api/users/23`).then(res => {
            setReceiver(res.data);
        });
    }
    console.log(receiver);
